(8, 4, 100, 2, 'Queen of Masks Ep. 1', 'Mengesampingkan masa lalu, tiga sahabat, Jae-yi, Yoo-jung, dan Hae-mi menjalani kehidupan yang sukses, hingga suatu tragedi terjadi tepat di depan mereka.', '2023 | Season 1 | PG-13 | Drama', NULL, NULL, NULL, NULL, NULL, 1, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 1@3x (1).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 1@3x.jpg', '-', 'N', '2023-07-20 14:31:26', '2023-08-04 11:20:43', '2023-07-15 12:45:00', '2023-07-15 13:59:00', 0),
(9, 4, 100, 2, 'Queen of Masks Ep. 2', 'Rencana itu hancur berantakan dengan kedatangan Yoo-na. Yoo-na membuat tawaran yang menggiurkan, tetapi Jae-yi tidak mempercayainya.', '2023 | Season 1 | PG-13 | Drama', NULL, NULL, NULL, NULL, NULL, 2, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 2@3x (1).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 2@3x.jpg', '-', 'N', '2023-07-20 14:44:59', '2023-08-04 11:20:46', '2023-07-15 14:00:00', '2023-07-15 15:14:00', 0),
(10, 4, 100, 2, 'Queen of Masks Ep. 3', 'Jae-yi menemukan petunjuk penting yang bisa mengungkap kebenaran insiden 10 tahun lalu. Dia juga mengetahui rahasia Yoo-na.', '2023 | Season 1 | PG-13 | Drama', NULL, NULL, NULL, NULL, NULL, 3, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 3@3x (1).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 3@3x.jpg', '-', 'N', '2023-07-20 14:48:19', '2023-08-04 11:20:51', '2023-07-15 15:15:00', '2023-07-15 16:29:00', 0),
(11, 4, 100, 2, 'Queen of Masks Ep. 4', 'Jae-yi berusaha membalas dendam kepada Yoo-na. Di pernikahan Yoo-jung, Jae-yi menerima pesan yang membuatnya ketakutan dan tidak percaya.', '2023 | Season 1 | PG-13 | Drama', NULL, NULL, NULL, NULL, NULL, 4, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 4@3x (1).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 4@3x.jpg', '-', 'N', '2023-07-20 15:04:54', '2023-08-04 11:20:56', '2023-07-15 16:30:00', '2023-07-15 17:44:00', 0),
(12, 4, 100, 2, 'Queen of Masks Ep. 5', 'Jae-yi memutuskan untuk bersekutu dengan Yoo-na untuk melawan pemilik topeng tersebut.', '2023 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 5, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 5@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 5@3x.jpg', '-', 'N', '2023-07-20 15:06:56', '2023-08-24 13:55:09', '2023-07-22 12:45:00', '2023-07-22 13:59:00', 1),
(13, 4, 100, 2, 'Queen of Masks Ep. 6', 'Yoo-na mulai ragu karena Je-hyuk berusaha untuk menenangkannya. Yoo-jung dan Hae-mi berpaling dari Jae-yi.', '2023 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 6, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 6@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 6@3x.jpg', '-', 'N', '2023-07-20 15:08:42', '2023-08-24 13:54:46', '2023-07-22 14:00:00', '2023-07-22 15:14:00', 1),
(14, 4, 100, 2, 'Queen of Masks Ep. 7', 'Jae-yi berusaha mencari cara lain untuk menemukan markas besar topeng tersebut. Yoo-na menjebak Jae-yi.', '2023 | Season 1 | PG-13 | Drama', NULL, NULL, NULL, NULL, NULL, 7, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 7@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 7@3x.jpg', '-', 'N', '2023-07-20 15:10:41', '2023-08-04 11:21:09', '2023-07-22 15:15:00', '2023-07-22 16:29:00', 1),
(15, 4, 100, 2, 'Queen of Masks Ep. 8', 'Jae-yi mengumpulkan keberanian untuk mengaku tentang insiden 10 tahun lalu, untuk mengungkapkan sifat sebenarnya Je-hyuk dan melindungi teman-temannya, tetapi segala sesuatunya tidak berjalan sesuai rencana.', '2023 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 8, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/QoM - EP 8@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/QoM - EP 8@3x.jpg', '-', 'N', '2023-07-20 15:12:37', '2023-08-24 13:54:05', '2023-07-22 16:30:00', '2023-07-22 17:44:00', 1),
(16, 5, 100, 2, 'Summer Guys Ep. 8', 'Ah-ran membuat proposal mengejutkan tentang Summer Guys kepada Jin Dal-rae. Woo-chan mengungkapkan perasaannya kepada Jin Dal-rae.', '2021 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 8, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Summer Guys - EP 8@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Summer Guys - EP 8@3x.jpg', '-', 'N', '2023-07-20 15:58:57', '2023-08-24 13:52:50', '2023-07-18 19:00:00', '2023-07-18 19:29:00', 0),
(17, 5, 100, 2, 'Summer Guys Ep. 9', 'Latihan untuk pertempuran mendatang tidak berjalan lancar dengan absennya Tae-oh. Woo-chan mencoba meyakinkannya.', '2021 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 9, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Summer Guys - EP 9@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Summer Guys - EP 9@3x.jpg', '-', 'N', '2023-07-20 16:02:29', '2023-08-24 13:52:17', '2023-07-19 19:00:00', '2023-07-19 19:29:00', 0),
(18, 5, 100, 2, 'Summer Guys Ep. 10', 'Jin Dal-rae mengatasi ketakutannya dan menampilkan pertunjukan api yang sukses. Seorang tamu tak terduga yang tampak mengenal Woo-chan muncul di bar.', '2021 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 10, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Summer Guys - EP 10@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Summer Guys - EP 10@3x.jpg', '-', 'N', '2023-07-20 16:05:13', '2023-08-24 13:51:34', '2023-07-19 19:30:00', '2023-07-19 20:14:00', 0),
(19, 6, 38, 2, 'Bungo Stray Dogs - The Strongest Man', 'Setelah kehancuran Sky Casino, Kunikida dihadapkan pada pilihan yang mengerikan. Ango, Atsushi, Lucy, dan Kyoka menyelidiki lebih dalam rahasia yang tersembunyi dalam kenangan Atsushi, dan Rampo membuktikan keahliannya sebagai detektif terhebat di dunia.', '2023 | Season 5 | PG-13', NULL, NULL, NULL, NULL, NULL, 1, 'Season 5', 5, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Bungo Stray Dogs Season 5  - EP 1@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Bungo Stray Dogs Season 5 - EP 1@3x.jpg', '-', 'N', '2023-07-20 16:55:09', '2023-08-24 13:49:46', '2023-07-19 20:30:00', '2023-07-19 20:59:00', 0),
(20, 6, 38, 2, 'Bungo Stray Dogs - The Answer to Everything', 'Kamui, pemimpin Decay of the Angel, memiliki halaman itu. Fukuzawa memerintahkan para detektif untuk menghancurkannya. Meskipun menjadi buronan, Ranpo dengan bangga muncul dalam konferensi pers, mengungkapkan kebenaran dan melibatkan polisi.', '2023 | Season 5 | PG-13', NULL, NULL, NULL, NULL, NULL, 2, 'Season 5', 5, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Bungo Stray Dogs Season 5  - EP 2@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Bungo Stray Dogs Season 5 - EP 2@3x.jpg', '-', 'N', '2023-07-20 16:57:38', '2023-08-24 13:50:23', '2023-07-19 21:00:00', '2023-07-19 21:30:00', 0),
(21, 8, 99, 4, 'Chasing the Dragon', 'Konten ini milik Celestial Tiger Entertainment (Celestial Movies). Donnie Yen berperan sebagai raja narkoba terkenal di dunia nyata, Crippled Ho, yang datang ke Hong Kong sebagai imigran ilegal pada tahun 1963.', '2017 | Sequels | PG-13', NULL, NULL, NULL, NULL, NULL, 1, 'Sequels', 1, 'https://picture.dens.tv/poster/files/lands/vod_410x230/1652244176_land.jpg', 'https://picture.dens.tv/poster/files/lands/1652244176_land.jpg', '-', 'Y', '2023-08-07 10:47:21', '2023-08-16 11:24:01', '2023-08-06 08:00:00', '2023-08-06 00:00:00', 0),
(22, 8, 99, 4, 'Chasing the Dragon II: Wild Wild Bunch', 'Konten ini milik Celestial Tiger Entertainment (Celestial Movies). Serial penculik miliarder Logan telah merajalela di Hong Kong. Sekarang, gengnya membidik anak panah di luar Hong Kong, ke raja Makau yang makmur.', '2019 | Sequels | PG-13', NULL, NULL, NULL, NULL, NULL, 2, 'Sequels', 1, 'https://picture.dens.tv/poster/files/lands/vod_410x230/1681274640_land.jpg', 'https://picture.dens.tv/poster/files/lands/1681274640_land.jpg', '-', 'Y', '2023-08-07 10:47:21', '2023-08-22 10:51:35', '2023-08-17 12:00:00', '2023-08-17 13:00:00', 0),
(23, 9, 100, 2, 'When My Love Blooms Ep.3', 'Jae-hyun mengambil langkah untuk menghentikan istrinya, Seo-kyeong, dari menelepon pertemuan dengan komite kekerasan di sekolah.', 'The Loosing Side', NULL, NULL, NULL, NULL, NULL, 3, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/EP3@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/EP3@3x.jpg', '-', 'Y', '2023-08-10 15:06:27', '2023-08-15 11:09:22', '2023-08-06 16:30:00', '2023-08-06 17:44:00', 0),
(24, 9, 100, 2, 'When My Love Blooms Ep. 4', 'Ji-soo ditahan di kantor polisi karena tidak memiliki wali. Jae-hyun menawarkan pekerjaan di meja kepada Ji-soo, namun dia menolak bantuan tersebut.', 'Jae Hyuns Dream', NULL, NULL, NULL, NULL, NULL, 4, 'Season 1', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/EP4@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/EP4@3x.jpg', '-', 'Y', '2023-08-10 15:20:06', '2023-08-15 11:05:41', '2023-08-06 17:45:00', '2023-08-06 18:59:59', 0),
(25, 10, 39, 1, 'Making It S2 MARATHON', 'Para pembuat terbaik dari seluruh penjuru negara menghadapi serangkaian proyek handmade yang harus mereka selesaikan dengan cara unik mereka masing-masing. Saat kompetisi berlangsung, tantangan-tantangan menjadi semakin sulit, dan pembuat yang paling tidak berhasil akan dieliminasi setiap minggunya. Acara ini mencapai puncaknya dalam pertarungan akhir antara dua pembuat terakhir. Berlangsung di suasana luar yang tenang, kepositifan, karakter, dan persahabatan budaya handmade bersinar melalui para host komedi dan para juri yang memberikan dorongan, panduan, dan banyak tawa.', '2018 | Season 2 | PG', '', 0, '', '', '', 0, '', 0, 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x.jpg', '', 'Y', '2023-08-10 16:47:50', '2023-09-07 14:38:27', '2023-08-04 18:00:00', '2023-08-04 23:59:00', 0),
(26, 11, 39, 1, 'Making It Australia S1 MARATHON', 'Dari keramik dan pyrography hingga ukiran, merajut, dan bahkan lampu gantung Chris Hemsworth, Making It Australia adalah seri kreatif dan DIY baru yang mengumpulkan Para Pembuat paling berbakat dari negara ini untuk memamerkan kejeniusan artistik mereka. Acara ini akan dipandu oleh pelawak, aktor, dan penulis Susie Youssef serta pelawak Harley Breen. Penuh kebahagiaan dan inspirasi, seri ini akan merayakan kekuatan transformatif seni dan kerajinan.', '2021 | Season 1 | PG', '', 0, '', '', '', 0, '', 0, 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 2@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (1).jpg', '', 'Y', '2023-08-10 17:12:40', '2023-09-07 14:38:41', '2023-08-05 00:00:00', '2023-08-05 12:04:00', 0),
(27, 12, 38, 1, 'Blood Blockade Battlefront MARATHON', 'Suatu hari, Kota New York seperti yang kita kenal tiba-tiba menghilang dalam kabut misterius. Kini dikenal sebagai Hellsalem''s Lot, tempat ini telah menjadi suatu tempat di mana dunia lain yang tak terbayangkan terhubung dengan realitas kita. Keseimbangan dalam dunia baru ini dilindungi oleh sebuah masyarakat rahasia yang dikenal sebagai Libra. Leo, seorang jurnalis dan fotografer yang tiba di kota tersebut, tiba-tiba direkrut untuk bergabung dalam barisan mereka.', '2015 | Season 1 | PG-13', '', 0, '', '', '', 0, '', 0, 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 2@3x (1).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (3).jpg', '', 'Y', '2023-08-10 17:27:06', '2023-09-07 14:38:55', '2023-08-08 20:00:00', '2023-08-09 01:29:00', 0),
(28, 13, 39, 1, 'Chicago Med S7 MARATHON', 'Bekerja di Unit Gawat Darurat adalah pekerjaan yang penuh tekanan, tetapi juga sangat memuaskan. Dapatkan gambaran melalui Chicago Med S7, sebuah drama medis Amerika yang memperlihatkan para dokter dan perawat di Gaffney Chicago Medical Center berjuang untuk menyelamatkan nyawa pasien mereka sambil mengatasi masalah pribadi mereka sendiri.', '2021 | Season 7 | PG-13', '', 0, '', '', '', 0, '', 0, 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 2@3x (2).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (5).jpg', '', 'Y', '2023-08-10 17:32:17', '2023-09-07 14:39:12', '2023-08-11 18:00:00', '2023-08-12 10:29:00', 1),
