(33, 16, 44, 4, 'The Great Train Robbery: A Copper''s Tale', 'Geng dan pemimpin mereka, Bruce Reynolds, tamak untuk melakukan perampokan yang lebih besar. Kereta pos Glasgow ke Euston dikabarkan membawa sejuta poundsterling. Reynolds mulai merencanakan cara untuk menjarah kereta tersebut.', 'A Copper''s Tale', NULL, NULL, NULL, NULL, NULL, 2, 'Sequels', 1, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 a@3x (1).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (10).jpg', '-', 'Y', '2023-08-15 14:40:39', '2023-08-18 09:17:03', '2023-08-13 15:15:00', '2023-08-15 16:49:00', 0),
