(46, 22, 60, 1, 'LIVE WCCB - Emmanuel Rodriguez vs. Melvin Lopez', 'Channel : Fight Sports <br>\nTayang : 12 Agustus 2023 <br>\nSiaran LANGSUNG pada tanggal 13 Agustus, dari MGM National Harbor di Oxon Hill, Maryland, AS, pertarungan utama antara dua petinju kelas bantam teratas dunia, Emmanuel Rodriguez dan Melvin Lopez, akan menentukan Juara Dunia Kelas Bantam IBF. Rodriguez (21-2) adalah mantan juara dunia, masuk pertarungan setelah kemenangan atas Gary Antonio Russell yang belum terkalahkan, dan saat ini menduduki peringkat #2 di dunia menurut IBF. Lawannya, Melvin Lopez (29-1), telah memenangkan 8 pertarungan beruntun dengan 7 di antaranya dimenangkan dengan stoppage, dan berada di peringkat #2 oleh WBA dan #3 oleh WBO dan IBF. Dengan kedua petinju berada di peringkat 3 besar dunia dalam divisi tersebut, pertarungan ini benar-benar bisa dimenangkan oleh siapa saja. Saksikan Rodriguez vs. Lopez untuk Juara Dunia Kelas Bantam IBF LANGSUNG pada 13 Agustus, hanya di FIGHT SPORTS.', '', '', 0, '', '', '', 0, '', 0, 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 a@3x (8).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (28).jpg', '', 'Y', '2023-08-16 17:12:52', '2023-09-07 14:41:05', '2023-08-13 08:00:00', '2023-08-13 10:00:00', 0),
